    ProductReview:
      "\n                    \n                        \u25c6\ub514\uc790\uc778\n\ub514\uc790\uc778\uc740 \ubb34\ub09c\ud55c \ub290\ub08c\uc758 \ud150\ud2b8\uc600\uc2b5\ub2c8\ub2e4. \uc624\ub798\uc804\ubd80\ud130 \ubd80\ubaa8\ub2d8\uaed8\uc11c \uad6c\ub9e4\ud558\uc2e0 \ud150\ud2b8\uc758 \uc0c9\uc0c1\uc774 \ud30c\ub780\uc0c9 \ubb34\uc9c0\uac1c \uc774\ub7f0 \ub290\ub08c\uc774\ub77c \ucd0c\uc2a4\ub7ec\uc6c0\uc774 \ub9ce\uc558\ub294\ub370, \uc774 \uc81c\ud488\uc740 \uc57d\uac04 \uadf8\ub808\uc774 \uc0c9\uc0c1\uc774\ub77c \ubb34\ub09c\ud558\uace0 \ud074\ub798\uc2dd\ud55c \ub290\ub08c\uc744 \uc92c\uc2b5\ub2c8\ub2e4. \uc2dc\uac04\uc774 \ub9ce\uc774 \uc9c0\ub098\ub3c4 \uc4f8 \uc218 \uc788\ub294 \uc88b\uc740 \uc0c9\uc0c1\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \uc544\ub9c8 \uba87\ub144 \ub4a4\uc5d0 \uaebc\ub0b4\ub3c4 \ucd0c\uc2a4\ub7fd\uc9c0 \uc54a\uc744 \ub514\uc790\uc778\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\n\n\ud06c\uae30\uc758 \uacbd\uc6b0\uc5d0\ub294 \uc678\ubd80 \ud150\ud2b8\ub9cc \uc124\uce58 \ud588\uc744 \ub54c\ub294 \uc5c4\uccad \ub113\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub108 \ud150\ud2b8 \uc81c\uc678\ud558\uace0 \uc124\uce58\ud574\ub3c4 \ubd84\uc704\uae30 \uc88b\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uc774\ub108\ud150\ud2b8\uc758 \uacbd\uc6b0\uc5d0\ub294 \ub113\uae34\ud55c\ub370 \uc131\uc778 4\uba85\uc774 \ud55c\uacc4\uace0 \uc544\uc774\ub4e4\uc774 \uc788\uc73c\uba74 5\uc778\uae4c\uc9c0\ub294 \uc5b4\ucc0c\uc800\ucc0c \uac00\ub2a5\ud560 \uac83 \uac19\uc558\uc2b5\ub2c8\ub2e4. \uc219\ubc15\ud150\ud2b8\ub85c\ub294 \ubb34\ub09c\ud558\uace0 \uac04\ud3b8\ud55c \ucea0\ud551\uc6a9\uc73c\ub85c\ub294 \ub108\ubb34 \uc88b\uc740 \uac83 \uac19\uc544\uc694.\n\n\u25c6\ubc29\uc218\n\ube44\uac00 \ub0b4\ub9ac\ub294 \uc2dc\uae30\uac00 \uc544\ub2c8\ub77c \uc81c\ub300\ub85c \ud655\uc778\ud558\uc9c0 \ubabb\ud588\ub294\ub370, \uc2ec\uc2e4\ub9c1 \ubc29\uc218 \ucc98\ub9ac\uac00 \ub418\uc5b4\uc788\uc2b5\ub2c8\ub2e4. \ubb3c\uc774 \uc0c8\uae30 \uc26c\uc6b4 \ubd80\ubd84\uc744 \ucd94\uac00\ub85c \uc2e4\ub9c1\ud574\uc11c \uc644\uc804 \ubc29\uc218\ub77c\uace0\ud558\ub124\uc694. \uac1c\uc778\uc801\uc73c\ub85c \uc800\ud76c\uc9d1 \ud150\ud2b8\ub294 \uc815\ub9d0 \uc61b\ub0a0\uaebc\ub77c \uc774\ub7f0 \uae30\ub2a5\uc774 \uc5c6\uc5b4\uc11c \ucea0\ud551\ud560 \ub54c \ubb3c\uc774 \ub9ce\uc774 \uc0c8\uc11c \uace0\uc0dd\ud588\ub358 \uae30\uc5b5\uc774 \ub098\ub124\uc694..\n\n\u25c6\uc124\uce58\n\uc124\uce58\ub294 \uc5b4\ub835\uc9c0 \uc54a\uc740 \ud3b8\uc774\uae34\ud55c\ub370 \ucc98\uc74c\uc5d0\ub294 \uc57d\uac04\uc758 \uc219\ub2ec\uc774 \ud544\uc694\ud560 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \ud3c9\uc18c\uc5d0 \ud150\ud2b8\ub97c \uba87\ubc88 \uccd0\ubcf4\uc2e0 \ubd84\ub4e4\uc740 \uae08\ubc29 \uac10\uc774 \uc624\uc2e4\ud150\ub370 \ucc98\uc74c \ud53c\ud305\ud558\uc2dc\ub294 \ubd84\ub4e4\uc740 \uc880 \ud574\uba5c\uc218 \uc788\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \ud639\uc2dc\ub77c\ub3c4 \ube60\ub974\uac8c \ud150\ud2b8 \uc124\uce58\ud558\ub294 \ubaa8\uc2b5\uc744 \ubcf4\uc5ec\uc8fc\uace0 \uc2f6\ub2e4\uba74 \ud63c\uc790\uc11c \ud150\ud2b8 \ud55c\ubc88 \uc124\uce58 \uc5f0\uc2b5 \ud574\ubcf4\uc2dc\ub294 \uac83\uc744 \ucd94\ucc9c\ud569\ub2c8\ub2e4. \ud63c\uc790 \ud150\ud2b8 \uce5c\ub2e4\uace0 \ub091\ub091\ub300\uba74 \uc194\uc9c1\ud788 \uc5c6\uc5b4 \ubcf4\uc774\uac70\ub4e0\uc694.\n\n\u25c6\ucd1d\ud3c9\n\uac1c\uc778\uc801\uc73c\ub85c \uc2dc\uae30 \ub54c\ubb38\uc5d0 \uc544\uc26c\uc6c0\uc774 \ub9ce\uc774 \ub0a8\uc558\uc2b5\ub2c8\ub2e4. \uc601\ud558\ub85c \ub5a8\uc5b4\uc9c0\ub294 12\uc6d4\uc5d0\ub294 \ucea0\ud551\uc774\ub098 \ud150\ud2b8 \ub2e4 \uc544\ub2cc\uac83\uac19\uc544\uc694. \ucea0\ud551 \uac14\ub2e4\uac00 \uadf8\ub0e5 \ub4dc\ub77c\uc774\ube0c\ub9cc \ud558\uace0 \ub3cc\uc544\uc654\uc5b4\uc694. \uc5bc\uc5b4 \uc8fd\uc73c\ub2c8\uae4c \uaca8\uc6b8 \uc9c0\ub098\uace0 \ub0a0\uc774 \uc880 \uc88b\uc544\uc2dc\uba74 \uadf8\ub54c \ucea0\ud551\uc744 \uc81c\ub300\ub85c \uac00\ubd10\uc57c\ud560 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\n                    \n                ",
