      "\n                    \n                        \ucea0\ud551\uc744 \uc2dc\uc791\ud55c \uc9c0 1\ub144\uc774 \ub2e4 \ub418\uc5b4\uac00\uc9c0\ub9cc \uc544\uc9c1\uc740 \ucd08\ubcf4\ucea0\ud551\ub7ec\uc785\ub2c8\ub2e4.\n\uacbd\ud5d8\uc774 \ub9ce\uc9c0\ub294 \uc54a\uc9c0\ub9cc \uba87\ubc88\uc758 \ucea0\ud551\uc744 \ud1b5\ud574 \n\ud150\ud2b8 \uc120\ud0dd\uc5d0 \uc788\uc5b4\uc11c \uc911\uc694\ud55c \ubd80\ubd84, \ubc18\ub4dc\uc2dc \uace0\ub824\ub418\uc5b4\uc57c \ud560 \ubd80\ubd84,\n\uc788\uc73c\uba74 \ub354 \uc88b\uc740 \ubd80\ubd84, \ub4f1 \ub098\ub984\uc758 \ud1b5\uacc4\ub294 \uc788\ub294 \ud3b8\uc774\ub78d\ub2c8\ub2e4.\n\uc774\ub7ec\ud55c \uc81c \ud310\ub2e8\uacfc \ucde8\ud5a5\uc744 \uace0\ub824\ud588\uc744 \ub54c \uce74\uc988\ubbf8 \uc9c0\uc624\ud328\uc2a4\ud150\ud2b8\ub294 \n\uc6b0\ub9ac\uac00\uc871 \ucea0\ud551 \ud150\ud2b8\uc5d0 \uc801\ud569\ud558\uace0 \uaf64 \uacfc\ubd84\ud55c? \ud150\ud2b8\ub77c\uace0 \uc0dd\uac01\ub41c \ub2f5\ub2c8\ub2e4.\n\n\ube44\uc2fc \ud150\ud2b8, \uc815\ub9d0 \ub9ce\uc9c0\uc694. \ud150\ud2b8\uc0b4 \ub54c100\ub9cc\uc6d0 \ub118\uae30\ub294 \uac83 \uc608\uc0bf\uc77c\uc774\uc5d0\uc694.\n\uadf8\ub807\uc9c0\ub9cc 75\ub9cc\uc6d0\uc774\ub77c\ub294 \uc561\uc218\ub294 \uacb0\ucf54 \uc801\uac70\ub098 \uc27d\uac8c \uc4f0\uc77c \ubcf4\ud1b5\uc758 \uae08\uc561\ub3c4 \uc544\ub2c8\uc9c0\uc694.\n\ucea0\ud551\uc740 \uac1c\ubbf8\uc9c0\uc625\uc778\ub370 \uc9c0\uc625\uad74\ubd80\ud130 \ub108\ubb34 \ud070 \uae08\uc561\uc73c\ub85c \uc2dc\uc791\ud558\uba74 \n\ub098\uc911\uc5d4 \ud1b5\uc7a5\uc774 \ub108\ub35c\ub108\ub35c\ud574\uc9c0\ub2c8\uae4c\uc694..\n\ub610 \uadf8\ub807\uc9c0\ub9cc!! \ud150\ud2b8\ub294 \ub300\ucda9 \uc544\ubb34\uac70\ub098 \uc0ac\uc11c\ub294 \uc548\ub418\ub294 \ud488\ubaa9\uc774\uc5d0\uc694!\n\uc815\ub9d0 \uace0\uc2ec\uc5d0 \uace0\uc2ec\ud574\uc11c \uc120\ud0dd\ud558\uace0 \uad6c\uc785\ud558\uc9c0\ub9cc \uc4f0\ub2e4\ubcf4\uba74 \ub2e8\uc810\uc774 \uacc4\uc18d \ubcf4\uc774\uac70\ub4e0\uc694.\n\ud2b9\ud788 \ub3d9\uacc4\ucea0\ud551\uc740 \ucd94\uc704\uc5d0 \uac15\ud574\uc57c\ud558\uace0 \uc2e4\ub0b4 \ub09c\ub85c\ub97c \uc0ac\uc6a9\ud574\uc57c\ud560 \uc218\ub3c4 \uc788\uae30\uc5d0 \n\uc6d0\ub2e8\uc18c\uc7ac\uc640 \ub370\ub2c8\uc544(D-\uc9c1\ubb3c\uc758 \uc2e4 \uad75\uae30)\ub97c \uc798 \ud655\uc778\ud558\uace0 \uc120\ud0dd\ud574\uc57c \ud569\ub2c8\ub2e4.\n\uc774\uac83\ub4e4\uc740 \uadf8\ub9ac\uace0 \uc2e4\ub0b4 \uc0dd\ud65c\uc2dc\uac04\uc774 \uae38\uc5b4\uc9c0\ubbc0\ub85c \ub9e4\uc6b0 \uc911\uc694\ud55c \uc0ac\ud56d\uc774\uc5d0\uc694.\n\ub354\uad6c\ub098 \uc800\ud76c\uac19\uc740 \uc5b4\ub9b0 \uac00\uc871\ub4e4\uacfc \ud568\uaed8\ud558\ub294 \ucea0\ud551\uc740 \ub354\ub354\uc6b1 \uadf8\ub807\uc8e0.\n\n\uc800\ub294 \ub124\uc774\ucc98\ud558\uc774\ud06c \ube0c\ub77c\uc774\ud2bc 6.4\uc640 \uce74\uc988\ubbf8 \uc544\uc2a4\ud130 \ub3d4\ub124\uc624 \ud150\ud2b8, \n\uadf8\ub9ac\uace0 \uc911\uace0 \uac70\uc2e4\ud615\ud150\ud2b8\ub97c \ubcf4\uc720\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\uac01\uac01 \uc7a5\ub2e8\uc810\uc774 \uc788\uc9c0\uc694. \uba87\uac1c\uc758 \ud150\ud2b8\ub97c \uacc4\uc808\uc774 \ubc14\ub01c\uc5d0 \ub530\ub77c \uc0ac\uc6a9\ud574 \ubcf8 \uacb0\uacfc\n\uc800\ud76c \uac00\uc871\uc5d0\uac8c \ub9de\ub294 \ud150\ud2b8\uc758 \uc120\ud0dd\uc5d0 \uc788\uc5b4\uc11c \uccb4\ud06c\ud574\uc57c \ud560 \ubd80\ubd84\uc774 \n1. 150d\uc774\uc0c1\uc77c \uac83.\n2. \ubb34\uac70\uc6b4 \uba74\ud150\ud2b8\ubcf4\ub2e4\ub294 \uac74\uc870\uac00 \ube60\ub974\uba74\uc11c \ubc29\uc218\uac00 \ub6f0\uc5b4\ub09c \uc625\uc2a4\ud37c\ub4dc\uc6d0\ub2e8\uc77c \uac83.\n3. \uac00\uc871\uc774 \uc5ec\ub7ff\uc774\ubbc0\ub85c \uac70\uc2e4\uc774 \ub113\uc744\uac83. (\uc911\uc694)\n4. \uae30\ubcf8 \uc218\ub0a9\uc774 \uc788\uc744 \uac83.\n\uc774\ub807\uac8c \uace0\ub824\ud558\uac8c \ub418\uc5c8\ub2f5\ub2c8\ub2e4.\n\n\uce74\uc988\ubbf8 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8\uc758 \uc7a5\uc810\uc744 \uac04\ub2e8\ud558\uac8c \uc774\uc57c\uae30\ud558\uc790\uba74\n1. 150D\uc774\uc0c1\uc758 \uc625\uc2a4\ud3ec\ub4dc\uc6d0\ub2e8 \uc0ac\uc6a9.\n2. \ub113\uace0 \ub192\uc740 \uc2e4\ub0b4.\n\uc785\ub2c8\ub2e4.\n\n\uc124\uce58\uc2dc, \uc2e4\ub0b4\ub113\uc774\uac00 320, 560\uc774\ubbc0\ub85c 4\uc778\uac00\uc871\uc774 \uc4f0\uae30\uc5d0 \uc801\ud569\ud55c \uc911\ud615\ud150\ud2b8\ub77c\uace0 \ubcfc \uc218 \uc788\uaca0\uc2b5\ub2c8\ub2e4. \n\ub192\uc774\ub3c4 210\uc774\ubbc0\ub85c \uacf5\uac04 \ucda9\ubd84\ud560 \uac83 \uac19\uace0\uc694.\n\n\uc81c \uac1c\uc778\uc801\uc73c\ub85c \uc0bc\uac01\ud3ec\ucf13 \ub450\uac1c\ub3c4 \ub9c8\uc74c\uc5d0 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4.\n\uc591\uce58\ub3c4\uad6c \ucf00\uc774\uc2a4\uac00 \ub530\ub85c \uc788\uc9c0\ub9cc \uac74\uc870\ub418\uae30\uc804\uc5d0 \ubcf4\uad00\ud558\uae30 \n\uc801\ud569\ud560 \uac83 \uac19\uace0\uc694,\n\uadf8\ub808\uc774\uc0c9\uc0c1\uc774 \uc608\uc0c1\ubcf4\ub2e4\ub3c4 \ub354 \uace0\uae09\uc2a4\ub7fd\uc2b5\ub2c8\ub2e4.\n\uc57d\uac04 \uce74\ud0a4\uac00 \uc11e\uc778 \uadf8\ub808\uc774\uc778\ub370 \ub2e4\ub978\uc7a5\ube44\ub4e4\uacfc \uc798 \uc5b4\uc6b0\ub7ec\uc9c8 \uc0c9\uc0c1\uc774\ub77c \ub9cc\uc871\ud558\uace0\uc694.\n\n\ubb34\uac8c, 23KG \uad49\uc7a5\ud788 \ubb34\uac81\uc2b5\ub2c8\ub2e4.\n\ubb34\uac70\uc6b4 \uba74\ud150\ud2b8\ub3c4 \uc368\ubd24\uc9c0\ub9cc \uc5ec\uc790\uc778 \uc81c\uac00 \ub4e4\uae30\uc5d0\ub294 \ubb34\ub9ac\uc785\ub2c8\ub2e4.\n\uc0b4\uc9dd\uc529\uc740 \ub4e4\uc744 \uc218 \uc788\uc5b4\uc694. \uadf8\ub807\uc9c0\ub9cc \ud5c8\ub9ac\ub97c \uc870\uc2ec\ud574\uc57c\ud569\ub2c8\ub2e4^^\n\uc6d0\ub2e8\uc790\uccb4\uc758 \ub450\uaed8\uac00 \uc788\uc5b4\uc11c \ub354\uc6b1 \uadf8\ub7f0\uac83 \uac19\uace0\uc694.\n\ud3f4\ub300\ub3c4 \uc801\uc740 \ud3b8\uc774 \uc544\ub2c8\uace0\uc694(\uadf8\ub9cc\ud07c \uac15\ud55c \ubc14\ub78c\uc5d0\ub3c4 \ud2bc\ud2bc\ud560 \uac83 \uac19\uc544\uc694)\n\uc6e8\uac74\uc774 \uc788\uac70\ub098 \uc624\ud1a0\ucea0\ud551\uc7a5\uc774 \uc544\ub2c8\uba74 \uc9c1\uc811 \ub4e4\uace0 \ub098\ub974\uae30\uc5d0\ub294 \n\ub0a8\uc131\ub4e4\uc774 \ub4e4\uae30\uc5d0\ub3c4 \uad49\uc7a5\ud788 \ubb34\ub9ac\uc77c \uac83 \uac19\ub2e4\uace0 \ud310\ub2e8\ub429\ub2c8\ub2e4. \n\n\ucea0\ud551\uc7a5\ube44\ub97c \uad6c\uc785\ud558\uba74\uc11c \uc740\uadfc\ud788 \uce74\uc988\ubbf8\uc81c\ud488\uc744 \ub9ce\uc774 \ubaa8\uc73c\uac8c \n\ub418\uc5c8\ub294\ub370\uc694. \ub514\uc790\uc778\uc774 \uad1c\ucc2e\uc544\uc11c \uac00\uaca9\ub300\ube44 \uad1c\ucc2e\uc544\uc11c \uadf8\ub807\uac8c \uc0ac\ub2e4\ubcf4\ub2c8\n\uc758\uc790, \ub79c\ud134, \uc591\ub150\ud1b5,\uba38\uadf8\ucef5 \ub4f1 \ud06c\uace0 \uc791\uc740 \ub9ce\uc740 \uc81c\ud488\ub4e4\uc744 \ubaa8\uc73c\uac8c \ub418\uc5c8\uc5b4\uc694.\n\uc5ec\ub7ec\uac00\uc9c0 \uc368\ubcf4\uba74\uc11c \uac00\uc131\ube44 \ub0b4\uad6c\uc131\ub3c4 \uad1c\ucc2e\uace0 \ub514\uc790\uc778\ub3c4 \uad1c\ucc2e\ub2e4\uace0 \uc0dd\uac01\ud588\ub2f5\ub2c8\ub2e4.\n\n12\uc6d411\uc77c \uce74\uc988\ubbf8 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8 \uccab \ud53c\uce6d\uc744 \ud569\ub2c8\ub2e4.\n\uc124\ub808\ub294 \ucea0\ud551 \uc990\uae30\uace0 \ub290\ub080\uc810, \ub2e4\uc2dc \uc801\ub3c4\ub85d \ud560\uac8c\uc694~~\n\uc601\ud558\ub85c \ub5a8\uc5b4\uc9c4 \ub0a0\uc528, \uc774 \ub140\uc11d\uc774 \uc800\ud76c \uac00\uc871\uc744 \uac15\ucd94\uc704\uc5d0\uc11c \uc798 \uc9c0\ucf1c\uc8fc\ub9ac\ub77c \ubbff\uace0 ^^\n\uc62c\ud574\ub3c4 \ucf54\ub85c\ub098\ub85c \uc9c0\ucce4\ub358 \uac00\uc871\ub4e4\uc758 \ub9c8\uc74c\uc744 \uc704\ub85c\ud558\ub294 12\uc6d4 \ub9c8\uc9c0\ub9c9 \ucea0\uc744 \n\uc790\uc54c \uc990\uae30\uace0 \uc624\uaca0\uc2b5\ub2c8\ub2e4.\n\n***** \uce74\uc988\ubbf8 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8 \uc124\uce58 \uc601\uc0c1, \ucc38\uace0\ud558\uc138\uc694~******\nhttps://youtu.be/KsKRdJL4iqQ\n********************************\n                    \n                ",
