    ProductReview:
      "\n                    \n                        \uce74\uc988\ubbf8 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8 \uadf8\ub808\uc774 \uc0c9\uc0c1 \ud6c4\uae30\ub97c \uc2dc\uc791\ud569\ub2c8\ub2e4! \n\uce74\uc988\ubbf8\ub294 2008\ub144\uc5d0 \ubc95\uc778\uc744 \uc124\ub9bd\ud558\uace0 2012\ub144\uc5d0 \uc815\uc2dd\uc73c\ub85c \n\ud648\ud398\uc774\uc9c0\uc640 AS \uc13c\ud130\ub97c \uc624\ud508\ud558\uba70 \uc2dc\uc791\ub41c \uc790\ub791\uc2a4\ub7ec\uc6b4 \ub300\ud55c\n\ubbfc\uad6d\uc758 \ucea0\ud551 \ube0c\ub79c\ub4dc\uc785\ub2c8\ub2e4. \n\n10\ub144\uc758 \uc5ec\uc815 \ub3d9\uc548, \uac00\uc131\ube44 \uc88b\uace0 \ud6cc\ub96d\ud55c \ub514\uc790\uc778\uacfc \uc6d0\ud65c\ud55c AS\n\ub85c \ucea0\ud37c\ub4e4\uc5d0\uac8c \uc785\uc18c\ubb38\uc774 \ub098\uba74\uc11c \ucea0\ud551 \uc7a5\ube44\ub97c \ub9cc\ub4dc\ub294 \uc5c5\uacc4\ub85c\n\uc368 \uc785\uc9c0\ub97c \ub2e8\ub2e8\ud788 \ud588\uc2b5\ub2c8\ub2e4. 2017\ub144\uc5d0\ub294 \u2714\ud55c\uad6d \uc18c\ube44\uc790 \n\ub9cc\uc871 \uc9c0\uc218 1\uc704\uc640 \u2714\ub300\ud55c\ubbfc\uad6d \uc6b0\uc218\ube0c\ub79c\ub4dc \ub300\uc0c1(KSBA)\uc744 \n\ucc28\uc9c0\ud558\uae30\ub3c4 \ud588\uc2b5\ub2c8\ub2e4. \uadf8\ub9cc\ud07c \ucea0\ud551 \uc7a5\ube44\ub97c \uc120\ud0dd\ud560 \ub54c, \ubbff\uace0 \n\uad6c\ub9e4\ud560 \uc218 \uc788\ub294 \ube0c\ub79c\ub4dc \uc774\uc9c0\uc694~\n\n\uc774 \uce74\uc988\ubbf8 \ube0c\ub79c\ub4dc\uc758 \ub300\ud45c\uc801\uc778 \uc81c\ud488\uc774 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8\uc785\ub2c8\ub2e4.  \n\ub300\ud615\uae09 \uac70\uc2e4\ud615 \ud150\ud2b8\ub85c \uc0c9\uc0c1\uc740 \u2018\ube14\ub799\u2019\uacfc \u2018\uadf8\ub808\uc774\u2019 \uc0c9\uc0c1 2\uac00\uc9c0\n\uac00 \ucd9c\uc2dc\ub418\uace0 \uc788\ub294\ub370 \uc774 \uc81c\ud488\uc740 \u2018\uadf8\ub808\uc774\u2019 \uc0c9\uc0c1\uc785\ub2c8\ub2e4.\n\n\uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8\ub294 \uc625\uc2a4\ud3ec\ub4dc \uc6d0\ub2e8\uc744 \uc801\uc6a9\ud55c \uc911\ub300\ud615 \uace0\uae09\ud615!!!\n\ud150\ud2b8\ub85c\uc368 \uc124\uce58\uac00 \ub9e4\uc6b0 \uc27d\uace0 \ub113\uc740 \ucc9c\uc7a5, \ucc3d\ubb38\uc758 4\uba74 \uac1c\ubc29\uc73c\ub85c \n\ud1b5\ud48d\uc131\uc774 \ub6f0\uc5b4\ub098\uace0 \ud3b8\uc758\uc131\uacfc \uae30\ub2a5\uc774 \uac15\uc870\ub41c \uace0\uae09\uc2a4\ub7ec\uc6b4 \ud150\ud2b8\n\uc785\ub2c8\ub2e4. \uc138\ub85c\ud615 \ud3f4\ub300\ub97c \uc801\uc6a9\uc2dc\ucf1c \ube60\ub974\uace0 \uc27d\uac8c \uc124\uce58\ud560 \uc218 \uc788\ub3c4\n\ub85d \uc81c\uc791\ub418\uc5c8\uc73c\uba70, \ud14c\ud504\ub860 \ucf54\ud305\uc73c\ub85c \ucc28\uad11\ub825\uacfc \ubc29\uc218\ub825\uc744 \ub192\uc600\n\uc2b5\ub2c8\ub2e4. \uc5b4\ub450\uc6b4 \ud1a4\uc758 \uc774\ub108\ud150\ud2b8\ub97c \uc801\uc6a9\ud558\uc5ec 2\uc911\uc73c\ub85c \ube5b\uc744 \n\ucc28\ub2e8\ud558\ubbc0\ub85c \ud3b8\uc548\ud558\uac8c \ucde8\uce68\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\n\ud150\ud2b8\uc758 \uc6d0\ub2e8\uc740 3\uc911\uc73c\ub85c \ub418\uc5b4 \uc788\ub294\ub370 \u2460\uac89\uba74\uc740 \ubc1c\uc218\uc640 \ubc29\uc218\uac00 \n\uac00\ub2a5\ud55c \ud14c\ud504\ub860 \ucf54\ud305\uc774 \ub418\uc5b4 \uc788\uace0 \u2461\uac00\uc6b4\ub370\ub294 \uc790\uc678\uc120 \ucc28\ub2e8\uc774 \n\ub418\ub294 UV\ucf54\ud305 \uc6d0\ub2e8, \u2462\uc548\ucabd\uc5d0\ub294 \uacac\uace0\ud55c \uc870\uc9c1\uc758 \uc0dd\ud65c\ubc29\uc218\uac00 \n\uac00\ub2a5\ud55c \ud3f4\ub9ac \uc625\uc2a4\ud3ec\ub4dc \uc6d0\ub2e8\uc744 \uc0ac\uc6a9\ud558\uc5ec \uc81c\ud488\uc758 \ud004\ub9ac\ud2f0\ub97c \n\ub192\uc600\uc2b5\ub2c8\ub2e4. \n\n\ub514\uc790\uc778\ub3c4 \uc774\uc058\uace0 \ud488\uc9c8\ub3c4 \uc88b\uc9c0\ub9cc \ubb34\uc5c7\ubcf4\ub2e4\ub3c4 \uac00\uaca9\uc774 \ud130\ubb34\ub2c8\n\uc5c6\uc73c\uba74 \uc548 \ub418\uaca0\uc9c0\uc694? \uc218\uc785 \ube0c\ub79c\ub4dc\uc778 \uc2a4\ub178\uc6b0\ud53ck\uc758 \ud150\ud2b8\uc640 \n\ud488\uc9c8\uacfc \ud06c\uae30\uac00 \ube44\uc2b7\ud558\uc9c0\ub9cc \uac00\uaca9\uc740 3/1 \uc815\ub3c4\ub85c 70\ub9cc \uc6d0\ub300\uc5d0 \n\ud310\ub9e4 \uc911\uc774\uba70 \uac00\uc131\ube44 \uc815\ub9d0 \ucd5c\uace0\uc785\ub2c8\ub2e4! (\ud0c0 \uc0ac\uc774\ud2b8 90~100 \n\ub9cc\uc6d0\ub300\ub85c \ucfe0\ud321\uc774 \uac00\uaca9\uc774 \uc81c\uc77c \ud569\ub9ac\uc801\uc785\ub2c8\ub2e4^^)\n\n\uadf8\ub2e4\uc74c\uc740 \uc124\uce58! \uac70\uc2e4\ud615 \ud150\ud2b8\uc758 \uc124\uce58 \uc2dc\uac04\uc774 \ub300\ubd80\ubd84 20~30\ubd84\n\uc778 \uac78 \uac10\uc548\ud558\uba74 10\ubd84 \ub0b4\uc678\ub85c \uc124\uce58\ud560 \uc218 \uc788\ub294 \ucd5c\uace0\uc758 \ud150\ud2b8\uac00 \n\uc544\ub2cc\uac00 \uc2f6\uc2b5\ub2c8\ub2e4. \uccab \uc124\uce58 \uc2dc\uc5d0\ub294 \uc2dc\uac04\uc774 \uc870\uae08 \uac78\ub9ac\uc9c0\ub9cc \uc124\uce58\n\ud558\uba74 \ud560\uc218\ub85d \ube68\ub77c\uc9c0\ub294 \uc2dc\uac04\uc744 \ub290\ub07c\uc2e4 \uc218 \uc788\uc744 \uac81\ub2c8\ub2e4. \u314e\u314e \n\ub300\ud55c\ubbfc\uad6d \uc0ac\ub78c\uc774 \uc9c1\uc811 \ub9cc\ub4e4\uc5b4 \uc6b0\ub9ac\ub098\ub77c \uc0ac\ub78c\uc774 \uac00\uc7a5 \uc798 \uc0ac\uc6a9\n\ud560 \uc218 \uc788\ub294 \ud3b8\ub9ac\ud568\uacfc \uc6b0\uc218\ud55c \ub514\uc790\uc778\uc73c\ub85c \uad6c\uc131\ub418\uc5b4 \uc788\ub294 \uce74\uc988\n\ubbf8 \uc9c0\uc624\ud328\uc2a4 \ud150\ud2b8\uc785\ub2c8\ub2e4.\n\n\u2714\uc6b0\uc218\ud55c\ud488\uc9c8! \u2714\ud3b8\ub9ac\ud55c\uc124\uce58! \u2714\ud655\uc2e4\ud55cAS!\n\uc798 \uc0ac\uc6a9\ud558\uaca0\uc2b5\ub2c8\ub2e4. \uac10\uc0ac\ud569\ub2c8\ub2e4\u2661\n                    \n                ",
